import React from "react";

export const SummaryTable = () => {
  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            {/* <th
                    className="each-column-border"
                    //hidden={header === "entity"}
                  >
                    Number
                  </th> */}
            {/* {ColumnHeadingNameSet?.map((header, number) => (
                    <th
                      key={header}
                      className="each-column-border"
                      //hidden={header === "entity"}
                    >
                      {header}
                    </th>
                  ))} */}
            <th className="each-column-border">Comments</th>
            <th className="each-column-border">Entity</th>
            <th className="each-column-border">Score </th>
            {/* <th className="each-column-border">Details</th> */}
          </tr>
        </thead>
        <tbody>
          <tr>
            {/* <td className="each-column-border">{index + 1}</td> */}
            {/* {ColumnHeadingNameSet.map((header) => (
                      <td
                        key={header}
                        className="each-column-border"
                        //hidden={row[header].equalsIgnoreCase(props.entityName)}
                      >
                        {row[header]} 

                      </td>
                    ))} */}

            <td className="each-column-border">
              Highest score Improvement for last one year
            </td>
            <td className="each-column-border">Dubai Chamber</td>
            <td className="each-column-border">+0.26</td>
            {/* <td className="each-column-border"> yoyo</td> */}
          </tr>
          <tr>
            <td className="each-column-border">
              Lowest score Improvement for last one year
            </td>
            <td className="each-column-border">UAE University</td>

            <td className="each-column-border">-0.1</td>
            {/* <td className="each-column-border">1</td> */}
          </tr>
        </tbody>
      </table>
    </div>
  );
};
